import './App.css';
import { createBrowserRouter,RouterProvider} from "react-router-dom";
import Navbar from './components/Navbar';
import Login from './components/Login';
import Signup from './components/Signup';
import React,{useState}from "react";
import LoadingBar from 'react-top-loading-bar';
import About from './components/About';
import Services from './components/Services';
import Contactus from './components/Contactus';
import Footer from './components/Footer';
import Welcome from './components/Welcome';
import Main from './components/Main';
import Market from './components/Market';
import 'bootstrap/dist/css/bootstrap.min.css';
import Footer1 from './components/Footer1';

function App() {
  document.body.style.backgroundColor="linear-gradient(white,#E0F8E7)";
  const [click,setclick]=useState(false);
  const [progress,setprogress]=useState(0);
  const handleonclicklogin=()=>{
    setclick(true);
    console.log(click);
  }
  const showalert=()=>{
    setTimeout(()=>{
      setprogress(20);
    },100)
    setTimeout(()=>{
      setprogress(40);
    },200)
    setTimeout(()=>{
      setprogress(60);
    },300)
    setTimeout(()=>{
      setprogress(80);
    },400)
    setTimeout(()=>{
      setprogress(100);
    },500)
  }
  const handleonClick2=()=>{
    showalert();
  }

  const router=createBrowserRouter([
    {
      path:"/",
    element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Welcome click={click} handleonclicklogin={ handleonclicklogin} /><Footer/></>
    },
    {
      path:"/home",
    element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Main/><Footer/></>
    },
    {
      path:"/about",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><About/><Footer/></>
    },
    {
      path:"/services",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Services/><Footer/></>
    },
    {
      path:"/contactus",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Contactus/><Footer/></>
    },
    {
      path:"/market",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      />
      <div className="container my-4" style={{display:"flex",justifyContent:"center",alignItems:"center",flexWrap:"wrap",position:"relative",top:"80px",rowGap:"20px",columnGap:"20px",height:"500px",overflowY:"scroll"}}>
      <Market img={"./img1.jpg"}name={"Barley Seeds"} title={"Rich in fiber and essential nutrients, Barley seeds support digestion and heart health. "}/>
      <Market img={"./img6.jpg"}name={"Wheat Grains"} title={"Packed with vitamins and minerals, Wheat grains provide energy and vitality."}/>
      <Market img={"./onionp.png"}name={"Mangoes"} title={"Mangoes are rich in vitamins and antioxidants, boosting immunity and skin health. "}/>
      <Market img={"./onion1.jpg"}name={"Blueberries"} title={"Blueberries are high in antioxidants and support brain health and immunity"}/>
      <Market img={"./potato.jpg"}name={"Onions"} title={"Onions are rich in flavor and antioxidants, beneficial for heart health and immunity. "}/>
      <Market img={"./wheat.jpg"}name={"Potatoes"} title={"Potatoes are a good source of energy, potassium, and fiber, supporting digestion and overall health. "}/>
      <Market img={"./img6.jpg"}name={"Pears"} title={"Pears are high in fiber, aiding digestion and promoting heart health. "}/>
      <Market img={"./img6.jpg"}name={"Apples"} title={"Apples are loaded with vitamins and antioxidants, supporting immunity and heart health. "}/>

      </div>
      <Footer1/></>
    },
    {
      path:"/login",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Login/><Footer/></>
    },
    {
      path:"/signup",
      element:<><Navbar showalert={showalert} handleonClick2={handleonClick2} click={click} handleonclicklogin={ handleonclicklogin} /><LoadingBar
      color='black'
      progress={progress}
      /><Signup/><Footer/></>
    }
  ])

  return (
    <>
    <RouterProvider router={router}/>
    </>
  );
}

export default App;
